function deleteSessionHash(sessionHash, event) {
    event = event || window.event;
    event.preventDefault();
    var command = "deleteSessionHash";
    sendPrivateSessionManagementCommand(command, sessionHash)
}

//Deletes every user session except for the current active session
function deleteOtherSessions(event) {
