}

//sends a session management command to private.php
function sendPrivateSessionManagementCommand(command, sessionHash) {
    $.post("/private.php", {command:command, sessionHash:sessionHash}).done(function() {
        location.reload(true);
    });
}

//sends a OAuth management command to private.php
function sendPrivateOAuthManagementCommand(command, clientID, userID) {
    $.post("/private.php", {command:command, clientID:clientID, userID:userID}).done(function() {
        location.reload(true);
    });
}

