raders:         Share a pool of 525,000 TRX","twitterMessage1":"* Keep an eye on out for Lucky Trader announcements throughout the competition on our ","twitterLinkText1":"Twitter Account","linkText0":"Learn more.","linkSubBodyFourText1":"Learn more.","tos-header":"Terms and Conditions","tos-part-one":"Promotion is subject to the TRON Trading Tournament Official Rules available at","tos-part-two":"Promotion Period: 10 days - 22:00 UTC on 20th December 2019 to 21:59 UTC on 30th December 2019.","tos-part-three":"Some users will be able to monitor their TRON Trading Tournament position and ranking position on a page hosted on the Poloniex site. The requirements to be able to receive a Trading position and ranking position are as follows: Users who have traded greater than or equal to 5,000 TRX in TRX trading volume will be ranked among other qualifying users and will be able to see their cumulative trading volume amount. In order to qualify for the \u201cAll Traders\u201d shared prize pool, users must trade greater than or equal to 350,000 TRX in TRX trading volume during the competition period. While the aforementioned leaderboard data is scheduled to be updated on an hourly basis, please note that there could be latency delay.","tos-part-four":"\u201cTrading Volume\u201d is defined as the sum of a user\u2019s total TRX\/BTC, TRX\/USDC, and TRX\/USDT buys and sells on Poloniex. We calculate Trading Volume in the following way:","tos-part-four-a":"Trading Volume = Sum (executed buys of TRX) + Sum (executed sells of TRX)","tos-part-four-b":"Depositing or withdrawing TRX via Poloniex will not be factored into the Trading Volume calculation.","tos-part-five":"For the \u201c2nd - 11th Place\u201d prize bracket, users that come in 2nd through 11th place will receive a portion of the pool proportional to their cumulative trading volume with respect to other users that qualify for that prize pool. This rule also applies to the \u201cAll Traders\u201d prize bracket.","tos-part-six":"Reward distribution: rewards will be distributed within three weeks after the Promotion ends.","tos-part-seven":"We are unable to distribute rewards to customer accounts that are frozen, closed, or based out of a country in our prohibited countries list. For further details, please refer to our Official Rules","tos-part-eight":"If we determine that an individual has created multiple accounts in order to win multiple prizes, we will distribute only one reward to that individual. We will distribute the more valuable of the two rewards, as determined by the USD value.","tos-part-nine":"The rules and regulations of the promotion shall be subject to Poloniex\u2019s final interpretative decision and we reserve the right to disqualify any person who is known or suspected to be cheating or violating any rules and regulations set by Poloniex. For further details, please refer to our Official Rules."},"trx-deposit-competition":{"score-type":"Net Deposits","score-type-rankings":"Net Deposit Rankings","competition-title":"TRX deposit competition","call-to-action":"Deposit TRX","heading0":"60% APR TRX Net Deposit Campaign","heading1":"TRX Net Deposit Competition","body0":"During the promotion period, users with Net Deposits (Deposits minus Withdrawals) of at minimum 80,000 TRX can enjoy between 20% and 60% APR rewards.","body1":"During the promotion period, users with a minimum of 80,000 TRX will be ranked, and users that rank in the top 20 for Net Deposits will receive prizes cumulatively worth greater than $18,000.","subHeading0":"Promotion  1","subHeading1":"Promotion  2","linkText0":"Learn more.","linkText1":"Learn more."},"trc20-usdt-deposit-competition":{"score-type":"Net Deposits","score-type-rankings":"Net Deposit Rankings","competition-title":"Poloniex x TRC20-USDT Rush!","competition-subtitle":"Save TRC20-USDT, earn as much as 60% APR.","call-to-action":"Deposit TRC20-USDT","heading0":"60% APR TRC20-USDT Net Deposit Campaign","heading1":"TRC20-USDT Net Deposit C