ition":{"score-type":"Trade Volume","score-type-rankings":"Trade Volume Rankings","competition-title":"TrueFi Trading Competition","competition-subtitle":"January 21, 2021 at 14:30 UTC to January 31, 2021 at 14:29 UTC","call-to-action":"Trade TRU\/USDT","call-to-action-right":"Trade TRU\/BTC","heading0":"Competition Overview","body0":"Make your way to the top of the leaderboard over the next 10 days and win from a prize pool of 60,000 TRU.","linkText0":"Learn more","heading1":"Prizes","subHeading1":"Earn prizes","subBody1":"1st-5th Places Share a pool of 12,000 TRU","subBodyTwo1":"6th-20th Places Share a pool of 18,000 TRU","subBodyThree1":"21st-50th Places Share a pool of 15,000 TRU","subBodyFour1":"51st-100th Places Share a pool of 10,000 TRU","subBodyFive1":"All Traders Share a pool of 5,000 TRU","body1":"Trade at least 5,000 TRU during the competition to be eligible for prizes."},"tru-trading-competition-tos":{"TOS-line-1":"Promotion is subject to the TrueFi Trading Competition Official Rules available at <a href='https:\/\/support.poloniex.com\/hc\/articles\/1500001718961' target='_blank'>https:\/\/support.poloniex.com\/hc\/articles\/1500001718961<\/a> (the \u201cOfficial Rules\u201d).","TOS-line-2":"Promotion Period: 10 days - 14:30 UTC on 21st January 2021 to 14:29 UTC on 31st January 2021.","TOS-line-3":"Some users will be able to monitor their position and rank on a page hosted on the Poloniex site. The requirements to be able to receive a Trading position and ranking position are as follows:","TOS-line-3-bullet-1":"Users who have traded greater than or equal to 300 TRU in trading volume will be ranked among other qualifying users and will be able to see their cumulative trading volume.","TOS-line-3-bullet-2":"To qualify for any prize pool, users must trade greater than or equal to 5,000 TRU in trading volume during the competition period.","TOS-line-3-bullet-3":"While the leaderboard data is scheduled to be updated on an hourly basis, there could be latency delay.","TOS-line-4":"\u201cTrading Volume\u201d is defined as the sum of a user\u2019s total buys and sells on Poloniex. We calculate Trading Volume in the following way:","TOS-line-4-bullet-1":"Trading Volume = Sum (executed buys of TRU pairs) + Sum (executed sells of TRU pairs)","TOS-line-4-bullet-2":"Depositing or withdrawing via Poloniex will not be factored into the Trading Volume calculation.","TOS-line-5":"The valid TRU markets that will count towards TRU trading volume are TRU\/USDT and TRU\/BTC.","TOS-line-6":"For the \u201c1st - 5th Places,\u201d \u201c6th - 20th Places,\u201d \u201c21st - 50th Places,\u201d and \u201c51st - 100th Places\u201d prize pools, users that come in 1st through 100th place will receive a portion of the pool proportional to their cumulative trading volume with respect to other users that qualify for that prize pool.","TOS-line-6-bullet-1":"Users in 1st through 100th places are not eligible for the \u201cAll Traders\u201d prize pool.","TOS-line-7":"For the \u201cAll Traders\u201d prize pool, all eligible users will receive an evenly split amount of the pool among other users that qualify for this prize pool.","TOS-line-8":"Reward distribution: rewards will be distributed within two weeks after the Promotion ends.","TOS-line-9":"We are unable to distribute rewards or airdrops to customer accounts that are frozen, closed, or based out of a country in our prohibited countries list. For further details, please refer to our <a href='https:\/\/support.poloniex.com\/hc\/articles\/1500001718961' target='_blank'>Official Rules<\/a>.","TOS-line-10":"If we determine that an individual has used multiple accounts in order to win multiple prizes, we will distribute only one reward to that individual. We will distribute the most valuable of the rewards, as determined by the USD value.","TOS-line-11":"The rules of the promotion shall be subject to Poloniex\u2019s final interpretative decision and we reserve the right to disqualify any person who is known or suspected to be cheating or violating any rules and regulations set by Poloniex. For further details, please refer to our <a href='https:\/\/support.poloniex.com\/hc\/articles\/1500001718961' target='_blank'>Official Rules<\/a>."},"ftt-srm-trading-competition":{"score-type":"Trade Volume","score-type-rankings":"Trade Volume Rankings","competition-title":"FTT & Serum Trading Competition","competition-subtitle":"January 23, 2021 at 00:00 UTC to January 29, 2021 at 23:59 UTC","call-to-action":"Trade FTT\/USDT","call-to-action-right":"Trade SRM\/USDT","heading0":"Competition Overview","body0":"Make your way to the top of the leaderboard over the next 7 days and win from a prize pool of 5,000 USDT.","linkText0":"Learn more","heading1":"Prizes","subHeading1":"Earn prizes","subBody1":"1st-10th Places Share a pool of 1,750 USDT","subBodyTwo1":"11th-20th Places Share a pool of 1,500 USDT","subBodyThree1":"21st-30th Places Share a pool of 1,250 USDT","subBodyFour1":"All Traders Share a pool of 500 USDT","body1":"Trade at least 1,500 USDT during the competition to be eligible for prizes."},"profile-page":{"profile-info":"Profile Info","limits-features":"Limits & Features","upgrade":"Upgrade","upgrade-100x-leverage":"Upgrade to 100x leverage","level-1":"Level 1","level-2":"Level 2","unverified":"Unverified","level-2-pending":"Level 2 Pending","level-1-verified":"Level 1 Verified","level-2-verified":"Level 2 Verified","verify-identity":"Verify Identity","verify-identity-alert-header":"Verify your identity","verify-identity-alert-content":"To trade and transact, you must verify your identity.","verification-pending-alert-header":"Verification Pending","verification-pending-alert-content":"Your information is being reviewed, and you will receive an email when the verification process is complete. Most verifications are completed within a few minutes, but it can take up to a few days.","location-restricted":"Not available in your country","geo-restricted-text":"Futures