shot requirements to participate in the swap. LaunchBase is not available to users who reside or work in the United States, or in countries or any jurisdictions subject to the regulation of OFAC. For more information on LaunchBase and eligibility, please visit our <a href='https:\/\/support.poloniex.com\/hc\/en-us\/articles\/1500011324202' target='_blank'>Help Center<\/a>.","project-overview":"Project Overview","project-overview-1":"APENFT is backed by the underlying technology of top-notch blockchains Ethereum and TRON with support from the world's largest distributed storage system BitTorrent to deliver the mission of registering world-class artworks as NFTs on the blockchain. APENFT Fund was officially registered and established in Singapore on March 29, 2021.","project-overview-2":"With the mission of registering world-class artworks as NFTs on the blockchain, APENFT aims to be the ARK Funds in the NFT space. It will invest efforts to build a bridge between top-notch artists and blockchain and support the growth of native crypto NFT artists. The founding of APENFT marks the beginning of a great journey to \"make artworks accessible to all\".","key-features-highlights":"Key Features and Highlights","advanced-technology":"Advanced technology","financial-muscle":"Financial muscle","extensive-partnership":"Extensive partnership","token-allocation-economic-model":"Token Allocation and Economic Model","token-text-1":"Artist partners, 30%","token-text-2":"DeFi mining, 19%","token-text-3":"NFT Team, 19%","token-text-4":"Initial exchange offering, 2%","token-text-5":"NFT art purchase, 20%","token-text-6":"Partners, 10%","NFT-token-release":"NFT Token Release","token-release-1":"NFT team holds 189,998,100,000,000 NFT, taking up 19% of the total issuance. This amount will be released at a speed of 7,916,587,500,000 NFT per month for 24 months;","token-release-2":"19% of the total supply, or 189,998,100,000,000 NFT, is earmarked for DeFi mining, which will be released in 23 months. In June 2021, 19,999,800,000,000 NFT will be released; a monthly supply of 7,916,587,500,000 NFT will be released from July 2021 to March 2023; the last release totaling 3,749,962,500,000 NFT will be made in April 2023.","data-item-h-1":"Total effective TRX holdings","data-item-h-2":"Total NFT giveaway","data-item-h-3":"Registration starts at","data-item-h-4":"Registration ends at","total-user-title":"Total number of users registered","sign-up-now":"Sign Up Now","already-signed-up":"Already Signed Up","commitment-ratio-title":"NFT booked","not-sign-up":"Sorry, you did not register","swap":"Swap","swapped":"Swapped","swap-again":"Retry to swap","swap-limit":"Your swapping limit","swap-success":"Your swapping request has been submitted","swap-fail":"Swap failed, please try again later","trx-not-enough":"Your TRX balance is not enough to swap.","registration-starts-in":"Registration starts in","detail-desc":"Only registered users are eligible for snapshots and only users whose snapshots meet requirements can receive NFT allotments. Each user can only swap and claim the airdrop once."},"ieo-jst":{"project-intro-p-1":"JUST aims to build a fair, decentralized financial system that provides stablecoin lending and governance mechanisms for users around the world. JUST is a two-token system. The first token, USDJ is a stablecoin pegged to the US Dollar at a 1:1 ratio and is generated by collateralizing TRX via JUST\u2019s CDP portal. JST, the second token, can be used for paying interest, platform maintenance, participating in governance through voting, and other activities on the JUST platform.","project-intro-p-2":"JUST allows  all transactions, collateralization, and governance to be transparently executed on-chain. JUST is built on the TRON Network, the largest decentralized application ecosystem, and aims to provide a set of easy-to-use and transparent financial services for all its members.","project-intro-ul-1":"JUST is a decentralized stablecoin project built on the TRON Network. It aims to provide a fair, open finance platform for anyone around the world.","project-intro-ul-2":"Users can generate the stablecoin, USDJ, by depositing an over-collateralized set of TRX assets.","project-intro-ul-3":"The project is governed by all JUST community members based on the number of JST that they hold. Proposals for the project are voted on and determined by all stakeholders.","key-feature-ul-1":"A stablecoin that is over-collateralized by asset reserves to help maintain price stability.","key-feature-ul-2":"Fast, efficient, and low-fee stablecoin transfers.","key-feature-ul-3":"Enables anyone to create a free account and generate USDJ using JUST\u2019s smart contracts.","key-feature-ul-4":"Anyone holding JST can participate in the governance of the USDJ system.","key-feature-ul-5":"Access to the thriving TRON ecosystem and its many decentralized applications.","launchbase-allocation-copy":"100% of Public Sale Allocation","public-price-copy":"1 JST = 0.124 TRX (approximately 1 JST = 0.00202 USD, based on the Poloniex TRX\/USDT rate at 2020-05-04 14:00:00 UTC)","individual-cap-copy":"2475247.52475 JST (approximately 5,000 USD, based on the Poloniex TRX\/USDT rate at 2020-05-04 14:00:00 UTC)","seed-sale-date-copy":"February 2020","token-type-copy":"TRC-20 (a native token of the TRON blockchain)","token-distro-copy":"Within 15 days of the token sale end","ecosystem-copy":"Comprises 30% of total supply","seed-sale-copy":"Comprises 11% of total supply","public-sale-lb-allocation-copy":"Comprises 4% of total supply","strategic-partners-copy":"Comprises 26% of total supply","team-copy":"Comprises 19% of total supply","airdrops-copy":"Comprises 10% of total supply","jst-distribution-chart-alt":"JUST token release schedule","jst-allocation-chart-alt":"JUST token allocation chart","sec-disclaimer":"JST tokens have not been and will not be registered under the US Securities Act of 1933, as amended (the \"Securities Act\"), and may not be offered or sold within the United States or to, or for the account or benefit of, U.S. persons except in certain transactions exempt from the registration requirements of the Securities Act."},"ieo-research-JST":{"header-1":"Decentralized finance for billions worldwide","header-2":"April 3rd, 2020","ticker":"Ticker","key-metrics":"Key Metrics","issuing-price":"Issuing Price","init-circ-supply":"Initial Circ. Supply","total-supply":"Total Supply","individual-cap":"Individual Cap","min-purchase-amount":"Minimum Purchase Amount","project-website":"Project Website","project-overview":"Project Overview","project-overview-ul-1":"JUST is a stablecoin project on the TRON Network, with the goal of providing a fair and decentralized finance platform for users worldwide.","project-overview-ul-2":"Users can mint stablecoin USDJ by depositing TRX assets as collateral in a smart contract.","project-overview-ul-3":"Project is governed by JUST community members based on the number of JST they hold. Proposals are voted upon and determined by the whole ecosystem.","keys-features":"Key Features &amp; Highlights","keys-highlights-ul-1":"Stablecoin over-collateralized by a reserve of assets to maintain price stability.","keys-highlights-ul-2":"Fast, efficient and nearly-free stablecoin transfer.","keys-highlights-ul-3":"Available to anyone, anywhere, anytime.","keys-highlights-ul-4":"World-class security by blockchain-based smart contracts.","keys-highlights-ul-5":"Any holder of JST can participate in the governance of the USDJ community.","keys-highlights-ul-6":"Platform access to the thriving TRON ecosystem, supported by hundreds of DApps.","what-is-just":"What is JUST?","project-mission":"PROJECT MISSION","project-mission-p-1":"JUST aims to build a fair and decentralized financial ecosystem that provides stablecoin lending and governance mechanisms for users around the world. All transactions, collateralization and governance are transparent and executed on-chain. JUST is built on the TRON Network, the largest decentralized application ecosystem, and aims to provide a set of easy-to-use and transparent financial services for users worldwide.","how-it-works":"HOW IT WORKS","how-it-works-p-1":"Any user can mint USDJ automatically via JUST\u2019s ecosystem of smart contracts by locking their TRX in collateralized debt positions (CDP) in the form of pooled TRX (PTRX). To mitigate against price fluctuation risks, over-collateralization of PTRX is required. The over-collateralization ratio is currently set at 150%, and can be changed by a vote of the community. If the value of the collateral falls below the predetermined liquidation ratio, the collateral is sold to pay off the debt and an additional liquidation penalty (currently 13%) is charged.","how-it-works-p-2":"JST is the governance token for the JUST network. By participating and voting in community proposals, JST holders have decision-making power over the JUST lending platform and can control the operations of the JUST network. In addition, JST can be used to pay interest on a CDP, in which case the paid JST will be burnt automatically by the smart contract.","token-sale":"Token Sale","token-econ":"Economics","token-name":"Token Name","token-type":"Token Type","seed-sale-allocation":"Seed Sale Allocation","seed-sale-price":"Seed Sale Token Price","seed-sale-date":"Seed Sale Date (Completed)","seed-sale-date-text":"February 2020","sale-proceeds":"Proceeds from Seed Sale","launch-base-allocation":"LaunchBase Sale Allocation","launch-base-price":"LaunchBase Sale Price","launch-base-total-allocation":"LaunchBase Total Allocation","seed-sale-overview":"Seed Sale Overview","seed-sale-overview-p-1":"Conducted in February 2020 and total proceeds of $3,267,000 USD was received at ~$0.00300 per token for 11.0% of the total token supply.","polo-seed-sale-overview":"Poloniex LaunchBase Sale Overview","polo-seed-sale-overview-p-1":"Sale will be conducted on May 5th, 2020 for aggregate proceeds of ~$799,920 USD worth of TRX. Each JST will be sold at ~$0.00202 USD per token for 4% of total token supply. The TRX price will be set prior to the sale start time.","supply-distribution":"Token Supply Distribution:","jst-ecosystem":"JST Token Ecosystem","governance":"Governance","governance-p-1":"JST token holders are responsible for the governance of the JUST ecosystem, which is performed by voting on proposals for the network. Each JST holder can vote and select the contract he\/she supports among all the smart contracts that modify the system parameters. The contract with the highest number of votes will be automatically adopted via on-chain smart contracts. Proposals can come in two forms:","single-contracts":"1. Single Action Proposal Contracts","single-contracts-p-1":"Single action proposal contracts are proposals that can only be executed after gaining root access, and after execution immediately applies its changes to the variables of internal system governance. The single-action proposal will then delete itself. While easy to use, this type of contracts offer less flexibility, and is expected to be more prevalent during the early stage of the system.","delegate-contracts":"2. Delegating Proposal Contracts","delegate-contracts-p-1":"Delegating Proposal Contracts are proposals that continuously utilize their root access through second layer governance logic. The second layer governance logic can be relatively simple, such as defining a protocol for holding a weekly vote on updated risk parameters. It can also implement more advanced logic, such as restrictions on the magnitude of governance actions within defined time periods, or even deleting permissions of its third layer Delegating Proposal Contracts with restrictions.","delegate-contracts-p-2":"There are no special requirements for initiating a proposal. Any TRON account can submit suggestions for improving the JUST ecosystem by deploying a smart contract proposal. JST holders can then use their JST tokens to cast votes for one or more proposals. This governance mechanism is designed to allow all governance measures to take place in a fair and transparent manner.","token-governance":"Token Governance &amp; Use of Funds","token-governance-p-1":"As of April 3rd, 2020 JST has not used any funds from the sale of tokens. Any funds received from the sale of tokens is expected to be spent according to the following allocations:","token-governance-ul-1":"[15%] Partnerships and community development","token-governance-ul-2":"[30%] Marketing","token-governance-ul-3":"[25%] Product Development","token-governance-ul-4":"[10%] Equipment and software","token-governance-ul-5":"[20%] Operational Costs","token-governance-p-2":"The team will hold funds in a multisig cold wallet.","jst-token-release-p-1":"The following chart shows the number of JST tokens that are expected to be released\ninto circulation on a monthly basis.","road-map":"Updated Roadmap","road-map-h1":"Q2 2020","road-map-h1-ul-1":"OpenPlatform: release developer SDK and API doc","road-map-h1-ul-2":"USDJ on multiple-exchanges, multiple-pair","road-map-h1-ul-3":"JST Launchbase","road-map-h2":"Q3 2020","road-map-h2-ul-1":"USDJ &amp; JST on decentralized exchanges","road-map-h2-ul-2":"Support DApp on TRON Network with USDJ integration","road-map-h2-ul-3":"JUST Forum &amp; chatroom","road-map-h2-ul-4":"Deliver one USDJ derivative DeFi product","road-map-h3":"Q4 2020","road-map-h3-ul-1":"Release JUST 2.0","road-map-h3-ul-2":"Support multi-collateral assets","road-map-h3-ul-3":"Collaborate with the community to implement more USDJ derivative DeFi products","road-map-h3-ul-4":"Deliver more DeFi products based on USDJ &amp; JST","road-map-h4":"Q1 2021","road-map-h4-ul-1":"Support Privacy coin collateral","road-map-h4-ul-2":"Support shielded transaction for USDJ &amp; JST","team-overview":"Team Overview","team-title-1":"Head Of Project","team-title-p-1":"Master of Computer Science at Stevens Institute of Technology, NJ. 7 years of working experience in Barclays and IBM. Blockchain Expert.","team-title-2":"Head of Technical","team-title-p-2":"7 years of development experience and smart contract experts. Blockchain researcher and senior developer. Experience in contract security, blockchain design, decentralized App implementation.","team-title-3":"Head of Product","team-title-p-3":"5 years working in Tencent, a specialist in wallets and exchanges","team-title-4":"Head of Operation","team-title-p-4":"Experienced blockchain engineer, extensive experience in the design and development of financial systems. 7 years of working experience In New Oriental Education Group, Qihoo 360. Early blockchain investors.","team-title-5":"Technical","team-title-p-5":"4 years of development experience. Developing experience in large-scale, high-performance DApp applications.","team-title-6":"Head Of Project","team-title-p-6":"Rich experience in the IT industry especially on the blockchain. The former core developer worked in Alibaba. Experience in DApps development of TRON and Ethereum.","team-title-7":"Front-end","team-title-p-7":"5 years of front-end experience, a former employee in Firefox. Participated in research and\ndevelopment of various portals, geographic websites, and mini-games.","social-channels":"Community and Social Channels (as of April 3rd 2020)"},"home-page":{"contract":"Contract","top-futures":"Top Futures","search-instructions":"Search for spot markets by coin name or symbol.","no-results":"No results","no-results-found":"No results found","search-markets":"Search markets","no-trade-data":"No trade data","trade":"Trade","chart":"Chart","volume":"Volume","price":"Price","change24h":"Change (24h)","market":"Market","hero-h1-1":"Your one-stop shop for ","hero-h1-2":"crypto trading","hero-h1-1-2021":"<b class=\"emphasis-cta\">Trade like a legend<\/b> on the legendary crypto exchange","hero-h2":"Trade Bitcoin, Ethereum, USDT, and the top altcoins on the legendary crypto asset exchange.","email-address":"