te Your Friends to Poloniex and Win Mega Trading Rewards!","intro-content":"Whether you\u2019re a professional trader, digital currency holder, or just a die-hard Poloniex fan, you can invite your friends to join Poloniex and earn rich spot\/margin\/futures trading rewards! Earnings for both you and your friends: it\u2019s a win-win.","invite-your-friends":"Invite Your Friends","instructions-title":"How does it work?","instructions-step-1-title":"Get your code","instructions-step-2-title":"Invite your friends","instructions-step-3-title":"Start your earning","instructions-step-4-title":"Expand your network","instructions-step-1-content-1":"All Poloniex customers can access their referral code from their account settings. ","instructions-step-1-content-2":" to find your referral code.","instructions-step-2-content":"Share your referral code with your friends, family, and on your social networking sites. Every person who signs up using your code will bring rewards to you.","instructions-step-3-content":"Welcome your referrals with a 10% trading fee rebate, and when they trade on Poloniex, you\u2019ll earn 20% of the trading fees they pay.","instructions-step-4-content":"The more you share, the more you earn. Keep sharing your referral code with your network to keep the earnings coming.","login-to-your-poloniex-account":"Login to your Poloniex account","login-to-your-poloniex-account-chinese":"","program-details-title":"Program Details","program-details-content-1-text":"Rewards will be paid out to inviters and referrals once each day in USDT;","program-details-content-2-text":"Spot and margin trading rewards are calculated based on the net spot and margin trading fees paid by referrals. Basic futures referral rewards are calculated based on the trading fees generated by the actual futures trading volume of the referrals;","program-details-content-3-text":"There is no time limit to inviters' spot and margin trading rewards while referrals are eligible to receive the rewards for up to 60 days from their signup date. There is no time limit to inviters' futures trading rewards while referrals are eligible to receive the rewards for up to 60 days from the day when they enable futures trading. However, inviters' rewards will be invalid once their referrals become VIPs or market makers;","program-details-content-4-text":"Level 1 and 2 users can participate in the referral program. There is no limit to the number of users each account can invite. A referral can only be connected to one inviter, and the referral must enter the inviter's referral code when creating a Poloniex account;","program-details-content-5-text":"Customers cannot invite accounts owned or controlled by existing Poloniex customers. Once this behavior has been detected, you will be disqualified from the Referral Program and all unpaid earned or accrued referral rewards will be cancelled immediately;","program-details-content-6-text-1":"Please ","program-details-content-6-text-2":" for more information on the referral policy for spot and margin trading. Please ","program-details-content-6-text-3":" for more information on the referral policy for futures trading;","program-details-content-7-text":"Join Poloniex-Stars Referral Program and earn up to 50% on your referrals' fees! ","program-details-content-8-text-1":"We are unable to accept referrals from and cannot pay out rewards to customer accounts that are frozen, closed, or based out of a country in our prohibited countries list. For further details, please refer to our ","program-details-content-8-text-2":";","program-details-content-9-text":"Poloniex Official reserves the right of final interpretation and revision of this program. If necessary, Poloniex Official has the right to modify the program details at its own discretion without prior notice to you. In case of a modification, updates will be immediately announced on Poloniex's official website. Please check the latest information timely on our website. By conti