and less-established projects that have been recommended for listing by our community. Assets in the Assessment tab may experience extreme price volatility.<br\/><br\/>We regularly review the performance of Assessment assets and should an Assessment project meet our Delisting Policy criteria, it may be removed from Poloniex on an expedited timeline.","innov-info-lvg":"Leveraged and volatility tokens are high-risk products that:<ul><li>Can gain or lose large amounts of their value in a day<\/li><li>Will perform differently than regular leveraged exposure<\/li><li>Will likely not sustain their target leverage long-term<\/li><\/ul>While leveraged and volatility tokens can be helpful tools for traders, it is not recommended to hold these assets long-term. Use caution when trading these assets and only trade them if you understand how they work. Learn more about leveraged and volatility token pricing, value, rebalancing, and other topics <a href=\"%1$s\/hc\/en-us\/sections\/360008086114\" target=\"_blank\" rel=\"noopener noreferrer\">on our Help Center<\/a>.","innov-info-pres":"President tokens are based on FTX futures contracts. Each token will expire to $1 if the relevant president wins the 2020 US presidential general election, and $0 otherwise.<br\/><br\/>Learn more about President tokens <a href=\"%1$s\/hc\/en-us\/articles\/360052070213\" target=\"_blank\" rel=\"noopener noreferrer\">on our Help Center<\/a>.","avg-price":"Avg Price","price-proper-case":"Price","sum":"Sum","text-status":"Status","text-closed":"Closed"},"futures":{"modal-header":"Enable Futures Trading","modal-text":"Futures is only available to customers who are Level 2 verified. Please verify your account to enable trading on Poloniex Futures.","modal-button":"Verify Your Account","modal-subtext":"Futures is not available to anyone who is resident, organized, or located in a restricted region territory.","geo-restricted-text":"Poloniex Futures is not available to anyone who is resident, organized, or located in a restricted territory.","frozen-for-trading-header":"This account is frozen for trading","frozen-for-trading-content":"To keep your identity and funds safe, some features have been temporarily disabled. Learn more about your account status by contacting support.","maintenance-modal-text-1":"We are currently performing maintenance on Futures. We apologize for the inconvenience and appreciate your patience. Please check our ","maintenance-modal-text-2":" for updates.","maintenance-wallet-freeze":"Futures is currently under maintenance. You cannot move funds to and from the futures wallet.","timeout-error":"Sorry, something went wrong. Please try again later.","trx-launch-modal-header":"TRX is Open for Trading on Poloniex Futures","trx-launch-modal-body":"Now you can trade TRON perpetual futures with up to 50x leverage on Poloniex Futures!","trx-launch-modal-button":"Start Trading","maintenance-competition-title":"Launch in Progress","maintenance-competition-text-1":"We\u2019re preparing our next trading competition for Poloniex Futures! Futures trading will be temporarily unavailable during this time. Check out our trading competition on ","maintenance-competition-text-2":"our Help Center","maintenance-competition-text-3":" and stay up to date on when Poloniex Futures will be back on ","maintenance-competition-text-4":"our Twitter","maintenance-competition-text-5":"."},"lending-risk":{"modal-header":"Lending is High Risk","modal-text":"Lending to third parties for use in margin trading cryptocurrencies is risky. You may realize significant gains or losses and should be well-prepared before you begin lending. Repayment risks include the inability of borrowers to liquidate positions in volatile markets and owing assets beyond what is held or available as collateral. As a result you may suffer significant losses if your principal, interest, or both are not paid in full. Please visit our Help Center to learn more about the risks of lending.","modal-button":"I understand the risks"},"margin-risk":{"modal-header":"Margin Trading is High Risk","modal-text":"The use of leverage and collateral to trade cryptocurrencies is complex and risky. You may realize significant gains or losses and should be well prepared before you begin trading. Margin risks may include the inability to liquidate positions during highly volatile markets, owing assets beyond what you hold in your account, and liquidation of your collateral to repay debts. Please visit our Help Center to learn more about the risks of margin trading.","modal-button":"I understand the risks"},"margin-eu":{"modal-header":"Get Started with Margin Trading","modal-text-1":"USDT and USDC Margin trading is now unlocked for your Poloniex account! Starting today, you can get 2.5x leverage on 15+ new margin trading pairs. ","modal-text-link":"Learn more","modal-text-2":" about margin and start trading.","modal-button":"Start Margin Trading"},"fee-tier":{"your-status":"Your Status","trading-tier":"Your Current Fee Tier","your-30-day-trading-volume":"Your 30 Day Trading Volume","next-tier-amount-required":"Trade %1$s more to reach the next fee tier and earn lower fees","fee-discounts":"Fee Discounts","pay-fees-with-trx":"Get 30% off your fees when you pay with TRX","you-have":"You currently have %1$s in your wallet","opt-in-to-pay":"Opt in to paying for your trading fees with TRX and enable your 30% fee discount","keep-a-balance":"Make sure to keep enough funds in your TRX wallet to continue using this discount","view-trx-wallet":"View TRX Wallet","fee-structure":"Fee Structure","tier":"Tier","30-day-trading-volume":"30 Day Trading Volume","trx-balance":"trx balance","maker-taker":"maker \/ taker fee","trx-maker-taker":"trx maker \/ taker fee","25-off":"30% off","na":"N\/A","apply-here":"Apply Here","market-maker-note":"We set up custom fee schedules for our Market Makers. If you\u2019re interested in applying, please","fill-out-form":"fill out this form","be-in-touch":"and we\u2019ll be in touch.","preview-fees":"Save 25% on your fees with TRX starting June 11th","preview-fees-link":"Enable Your Discount","preview-fees-note":"Note: These fees will take effect on June 11, 2020 at 00:00 UTC. You can opt-in to pay your fees with TRX now to receive your 25% fee discount as soon as our fees are updated.","preview-fees-note-link":"Click here to see the current fee structure.","fee-disclaimer":"Every 24 hours, your 30 day trading volume and current TRX balance will be calculated and your fee tier will be dynamically updated according to the structure above. TRX must be held in your exchange account to be eligible for Fee Tier 2. The USD equivalent of your TRX balance is calculated based on the daily average TRX-USD price.","fee-disclaimer-link":"Learn more about our fees","welcome-modal-header":"Pay Less in Trading Fees","welcome-modal-body":"Get a 30% discount on your trading fees when you pay for your fees with TRX! Enable your discount and start paying less to trade.","welcome-modal-button":"Enable 30% Discount","faqs":"FAQS","faq-30-day-volume-calc":"How is my 30 day volume calculated?","faq-30-day-volume-calc-answer":"The USD equivalent of your 30 day trade volume is calculated based on the daily average BTC-USD rate (using a 24-hour weighted average price).","faq-trx-calc":"How is my TRX balance calculated?","faq-trx-calc-answer":"TRX must be held in your exchange account to be eligible for Fee Tier 2. The USD equivalent of your TRX balance is calculated based on the daily average TRX-USD price.","faq-maker-taker":"What does \u201cmaker\u201d and \u201ctaker\u201d mean?","faq-maker-taker-answer":"There are two parties involved in every trade: the maker, whose order exists on the orderbook prior to a trade being executed, and the taker, who places an order that matches (or takes) the maker's order.","fee-schedule":"Fee Schedule","trading-fees":"Trading Fees","futures-trading-fees":"Futures Trading Fees","margin-interest-fees":"Margin Interest Fees","margin-interest-fees-p1":"Margin traders pay interest to their lender based on the amount they loan. The interest rate is specified in the loan offer and is charged once your margin position has been closed.","margin-interest-fees-p2":"Margin trades are also subject to the trading fees outlined above.","lending-fees":"Lending Fees","lending-fees-p1":"15% of the interest earned by a lending customer will be collected by Poloniex as a lending fee.","dep-withdraw-fees":"Deposit and Withdrawal Transaction Fees","dep-withdraw-fees-p1":"We do not charge fees for depositing crypto into your Poloniex account. When you withdraw assets from your wallet, there is a fixed fee per asset to cover the cost of broadcasting a transaction to the network.","dep-withdraw-fees-p2":"You can also transfer funds between Poloniex accounts for free with","dep-withdraw-fees-p2-link":"Off-Chain Transfers.","last-updated":"This page was last updated on","fee-schedule-explanation":"Trading fees are charged on a per-trade basis. As your rolling 30 day trade volume increases to the next fee tier, your maker \/ taker fee rate will decrease. Every 24 hours, your 30 day trading volume and current TRX balance will be calculated and your fee tier will be dynamically updated according to the structure above.","view-trading-tier-link":"View your trading tier status","view-trading-tier-part2":"to see which fee tier is applied to your account.","every-24-hours":"Calculated every 24 hours","fee-vouchers-futures-h1":"Futures Fee Vouchers","fee-vouchers-futures-title":"Get a discount on your Futures trading fees","fee-vouchers-futures-subtitle":"Pay a flat fee and get a discount on your Futures trading for 3 or 7 days","fee-vouchers-futures-modal-cta-btn":"Get a Fee Voucher","fee-vouchers-futures-modal-title":"Futures Trading Voucher","fee-vouchers-options":"OPTIONS","fee-vouchers-most-popular":"Most Popular","fee-vouchers-buy":"Buy Fee Voucher","fee-vouchers-buy-success-title":"Fee Voucher Confirmed","fee-vouchers-buy-success-subtitle":"Change in fees do not happen immediately. You will receive an email confirmation shortly.","fee-vouchers-activation-note":"Discounted fee rates will be activated within 3 business days.","futures_5_percent_3_days":"5% futures trading discount for 3 days","futures_10_percent_3_days":"10% futures trading discount for 3 days","futures_10_percent_7_days":"10% futures trading discount for 7 days","fee-vouchers-purchased":"Fee voucher purchased","zero-fee-tips":"The fee structure is not applicable for the trading pairs that enjoy 0 fee.","zero-fee-learn-more":"Learn more about 0 fee Trading.","get-super-vip":"<a href='https:\/\/support.poloniex.com\/hc\/en-us\/articles\/10460929879959' target='_blank'>Get advanced VIP, enjoy super discount transaction fee, click to view>>>","spot":"Spot","futures":"Futures"},"futures-landing":{"intro-header":"Poloniex Futures Coming Soon","intro-1":"Trade on <strong>web<\/strong>, <strong>mobile<\/strong>, or through our <strong>APIs<\/strong>","intro-2":"Get up to <strong>100x leverage<\/strong> on Bitcoin","intro-3":"Receive the <strong>highest maker rebates & lowest taker fees<\/strong> in the industry","intro-header-v2":"Poloniex Futures","intro-1-v2":"Trade on <strong>web<\/strong>, <strong>mobile<\/strong>, or through our <strong>APIs<\/strong>","intro-2-v2":"Get up to <strong>100x leverage<\/strong> on Bitcoin","intro-3-v2":"Receive the <strong>highest maker rebates<\/strong> in the industry","intro-2-v3":"Get up to <strong>100x leverage<\/strong> on Bitcoin and Ethereum","intro-2-v4":"Get up to <strong>100x leverage<\/strong> on Bitcoin and Ethereum, Bitcoin SV, and Bitcoin Cash","intro-2-v5":"Get up to <strong>100x leverage<\/strong> on Bitcoin, Ethereum, and 5+ other crypto assets","intro-2-v6":"Get up to <strong>100x leverage<\/strong> on Bitcoin, Ethereum, TRON, and 5+ other crypto assets","table-label-1":"","table-content-1":"Leverage","table-content-1-2":"Expiration","table-content-1-3":