"table-content-11-4":"USDT","table-content-11-5":"0.01% maker \/ 0.075% taker","futures-apis-intro-title":"Rich, Easy to Integrate APIs","futures-apis-intro-p-1":"Poloniex Futures provides easy integration to interact with our futures exchange through both REST APIs and Websocket Feeds. Both allow read access to public market data and private read access to your account. Private write access to your account is available via the private REST API.","futures-apis-intro-p-2":"Our sample Python script and trading strategies enable you to get started with API trading quickly and tailor your trading strategy in minutes.","create-your-api-key":"Create Your API Key","read-api-docs":"Read API Docs","try-our-sample-api-script":"Try Our Sample API Script","what-are-futures-title":"What are futures?","what-are-futures-subtitle-1":"Futures","what-are-futures-content-1":"Futures, also called futures contracts, are agreements to buy or sell currencies, commodities, or other financial instruments at a predetermined price and time and can be cash settled or physically settled. When you buy or sell a crypto futures contract, you are interacting with a contract that represents the asset rather than the asset itself. Once the contract is exercised, the exchange of the actual asset occurs.","what-are-futures-subtitle-2":"Perpetual contracts","what-are-futures-content-2":"Perpetual contracts are similar to futures contracts but don't have an expiration date. This means you can hold a position in a perpetual contract for as long as you'd like. The price of a perpetual contract is based on an underlying index price which means that perpetual contracts are often traded at a price that is similar to spot markets.","futures-benefits":"What are the benefits of trading futures?","hedging":"Hedging","hedging-content":"Short or go long in a futures contract to hedge against adverse price movements of the underlying asset ","price-speculation":"Price speculation","price-speculation-content":"Futures contracts allow you to speculate on the direction of the underlying asset's price","trade-leverage":"Trade with 100x leverage","trade-leverage-content":"You don't need to put up 100% of the contract's value amount when trading","what-is-leverage":"What is leverage?","what-is-leverage-content":"Leverage allows a trader to enter a position without needing to put up 100% of the contract's value amount. Instead, you put up an initial margin amount, which consists of a fraction of the total contract value.","first-to-trade":"Be the first to trade on Poloniex Futures","sign-up":"Sign up to get notified as soon as we launch","email-address":"Email","get-notified":"Get Notified","futures-learn-more-card-title":"Learn more about Poloniex Futures","futures-learn-more-card-p":"Visit our Help Center to learn more about futures trading","learn-more":"Learn More","trade-bitcoin":"Trade Bitcoin","trade-ethereum":"Trade Ethereum"},"transfer-modal":{"accept-terms":"Enable","accept-terms-reason":"Please activate your Futures Account before transferring the balance.","accepted":"Accepted","failure-message":"We apologize but something went wrong and the transfer failed. Please try again.","success-message":"Your transfer of %1$s %2$s from your %3$s to your %4$s is complete.","transfer-complete":"Transfer Complete","futures-enable-title":"Futures Trading in High Risk","futures-enable-prompt":"The use of leverage and collateral to trade cryptocurrencies is complex and risky. You may realize substantial gains or losses and should be well prepared before you begin trading. Relatively small price movements will have a larger impact on your trading. Even in times of low price volatility, it is possible for the total balance in your futures wallet to be liquidated. Please %1$s to learn more about the risks of futures trading.","futures-enable-visit-link":"visit our Help Center","futures-enable-agree":"I Understand The Risks","futures-enable-skip":"Maybe Later","futures-enable-back":"Back","amount-placeholder":"Enter amount","max-amount-prompt":"Max"},"confirm-action":{"confirm-transfer":"Confirm Transfer","cancel-transfer":"Cancel Transfer","from":"From","to":"To","amount":"Amount","date-requested":"Date requested","spot":"Spot Account","exchange":"Exchange Account","margin":"Margin Account","lending":"Lending Account","futures":"Futures Account","wink":"WINk Account","transfer-successful":"Transfer Successful","transfer-successful-body":"Your balance transfer was completed successfully","transfer-cancelled":"Transfer Cancelled","transfer-cancelled-body":"Your balance transfer was cancelled successfully","transfer-error":"Transfer Failed","invalid-hash":"Invalid confirmation URL","invalid-hash-transfer-help-1":"If you are having trouble transferring, please","invalid-hash-transfer-help-2":"visit your balance transfer page","invalid-hash-transfer-help-3":"or","invalid-hash-transfer-help-4":"contact support"},"notices":{"empty-state":"No notice."},"learn-bchfork":{"header-title":"Bitcoin Cash Pre-Fork Trading","header-content":"Get early access to Bitcoin Cash Node (BCHN) by claiming your Bitcoin Cash for BCHA and BCHN. Deposit Bitcoin Cash to claim your tokens and begin pre-fork trading.","header-cta":"Deposit BCHABC","primary-content-title":"Claim your BCHA and BCHN Early","primary-content-body":"Before the Bitcoin Cash fork, you can either hold your BCHABC in your Poloniex wallet and receive any forked assets after that or you can claim your BCHA and BCHN before the fork and trade those tokens in our pre-fork trading markets. Learn how to begin claiming your BCHA and BCHN below.","primary-card-1-header":"Claim BCHA and BCHN","primary-card-1-content":"BCHABC holders can claim forked tokens early. 1 BCHABC = 1 BCHA and 1 BCHN.","primary-card-2-header":"Trade Early","primary-card-2-content":"Once you claim your BCHA and BCHN, you can trade them in our BTC and USDT markets.","primary-card-3-header":"Convert to BCHABC","primary-card-3-content":"You can choose to convert your BCHA and BCHN tokens back to BCHABC at any time.","primary-card-4-header":"Prepare for the Fork","primary-card-4-content":"After the fork, we\u2019ll distribute tokens to holders on Poloniex as applicable.","claim-your":"Claim Your BCHA and BCHN","frequently-asked-questions":"Frequently Asked Questions","terms-card-1-title":"What is pre-fork trading?","terms-card-1-content":"Just like we did back in 2018, we\u2019re offering customers the option to trade the two tokens involved in the upcoming Bitcoin Cash fork before the fork occurs. This allows traders to get early access to these tokens and show their support.","terms-card-2-title":"What are BCHA and BCHN?","terms-card-2-content":"Bitcoin Cash ABC (BCHA) and Bitcoin Cash Node (BCHN) are the tokens at the center of the debate about the upcoming Bitcoin Cash hard fork in November 2020. You can find more information on our ","terms-card-3-title":"What is expected to happen with the Bitcoin Cash fork?","terms-card-3-content":"While there are many ideas out there, we cannot say what will happen as a result of the Bitcoin Cash fork. As an exchange, we aim to remain neutral and empower our community to demonstrate their support through trading.","terms-card-4-title":"Do I have to claim my BCHA and BCHN now?","terms-card-4-content":"You do not need to claim BCHA and BCHN or engage in pre-fork trading. You can also choose to hold your BCHABC in your Poloniex wallet at the time of our fork snapshot and we\u2019ll distribute any forked assets after that.","terms-card-5-title":"What are the risks of pre-fork trading?","terms-card-5-content":"Trading in these tokens can be extremely risky so please trade at your own risk. There is a possibility that one of these chains will not be sustained after the fork. In that case, the corresponding token could lose all value.","terms-card-6-title":"Where can I learn more?","terms-card-6-content":"You can learn more about our Bitcoin Cash pre-fork trading,  how claim your Bitcoin Cash ABC (BCHA) and Bitcoin Cash Node (BCHN), and information related to the upcoming Bitcoin Cash fork on Poloniex on our "},"learn-defi":{"header-title":"DeFi 101: Tokens, Tools, and Trading","header-content":"From smart contracts and oracles to yield farming and liquidity pools, DeFi comes with lots of concepts that can make it hard to keep up. In our Beginner\u2019s Guide to DeFi, we break down these terms and help you stay up to date with the latest in DeFi.","defi-markets-title":"DeFi Markets on Poloniex","defi-markets-subtitle":"Check out the %1$s DeFi assets in our Innovation Zone","what-is-defi":"What is DeFi?","what-is-defi-content":"DeFi is an abbreviation of the term decentralized finance which refers to the ecosystem of assets, smart contracts, protocols, and decentralized applications (DApps). The DeFi ecosystem aims to create an open and accessible financial system that doesn\u2019t need to rely on a central authority.","defi-vs-tradfi":"DeFi vs. TradFi","defi-vs-tradfi-content":"All this talk of DeFi probably has you wondering, what\u2019s the main difference between DeFi and TradFi (Traditional Finance)?","defi":"DeFi","defi-desc-1":"Gives the control over to users","defi-desc-2":"Is widely accessible and transparent","defi-desc-3":"Overcomes many of the restrictions in traditional finance","tradfi":"TradFi","tradfi-desc-1":"Relies on central authorities","tradfi-desc-2":"Is commercially recognized","tradfi-desc-3":"Can typically provide simpler user experiences","defi-use-cases-title":"What are the use cases for DeFi?","defi-use-cases-content":"There are many different applications and services created within the DeFi ecosystem, with more popping up all of the time. Some of the most popular DeFi use cases today are lending and borrowing, trading, and stablecoins.","defi-use-case-1-title":"Lending &amp; Borrowing","defi-use-case-1-content-1":"One of the most popular use cases for DeFi today is lending and borrowing through decentralized lending protocols. Similar to the way that ","defi-use-case-1-link":"our P2P lending","defi-use-case-1-content-2":" works, DeFi lending protocols allow lenders to earn interest on their crypto assets and while giving borrowers access to more capital for trading, typically with leverage.","defi-use-case-2-title":"Trading","defi-use-case-2-content":"Decentralized exchanges, also known as DEXs, enable users to trade crypto assets without giving up the ability to self-custody their assets. When trading on a DEX, users can exchange assets with each other, peer-to-peer, without needing to trust each other or a third-party. There are also DeFi derivatives products that provide a decentralized alternative for advanced trading features like futures, indices, and options.","defi-use-case-3-title":"Stablecoins","defi-use-case-3-content":"Stablecoins are a type of cryptocurrency that are pegged to a stable asset of some kind, typically fiat currencies. Like many other DeFi use cases, stablecoins are created with varying levels of decentralization. Decentralized stablecoins provide more everyday use cases for cryptocurrency as they are not subject to the typical volatility that is involved with other crypto assets.","defi-use-case-4-title":"Other Use Cases","defi-use-case-4-content":"Other use cases, from insurance to mortgages and more, are constantly being created and improved upon as the interest in DeFi increases. We\u2019ll likely see more and more use cases for DeFi in the coming months and years.","defi-terms-title":"DeFi Terms To Know","defi-terms-content":"As with any industry, there are many terms to know when you\u2019re learning about DeFi. Dive into some of the top terms and buzzwords in DeFi below.","defi-terms-card-1-title":"Smart Contract","defi-terms-card-1-content":"A smart contract is a self-executing contract where contract terms are directly written into the code.","defi-terms-card-2-title":"Permissionless","defi-terms-card-2-content":"In a permissionless system, anyone can participate in the network and contribute to building and maintaining it.","defi-terms-card-3-title":"Interoperable","defi-terms-card-3-content":"When a system is interoperable, that means value and information can be shared freely across networks without intermediaries.","defi-terms-card-4-title":"Liquidity Pool","defi-terms-card-4-content":"A liquidity pool is used to improve trading by creating a large pool so traders can swap between assets without set trading pairs.","defi-terms-card-5-title":"Yield Farming","defi-terms-card-5-content":"At a basic level, yield farming is when users put their funds to work in an attempt to generate the biggest returns possible.","defi-terms-card-6-title":"Oracle","defi-terms-card-6-content":"Oracles are used by smart contracts to connect with \u201creal-world\u201d data that can then be used to execute the contract\u2019s terms.","email-notification-title":"Get notified about our new DeFi listings and offerings","email-notification-button-text":"Get Notified"},"app-download-landing":{"page-title":"Trade crypto everywhere you go","page-title-rebrand":"Trade crypto <b class=\"emphasis-title\">everywhere you go<\/b>","page-content":"We have what you need to trade how you want, when you want. Download our mobile app and start trading today!","download-now":"Download now","download":"Download","poloniex-app":"Poloniex App","legendary-crypto-exchange":"Legendary Crypto Exchange"},"rewards":{"hero-title":"Welcome to Poloniex Loyalty Rewards","hero-subtitle":"You can earn points for certain actions you take within the Poloniex ecosystem, As your points accumulate, you can increase your user status which earns you better rewards. Once you reach a certain threshold of points, you can cash them in for prizes.","hero-cta":"View Rules"},"cards-page":{"page-title":"Card Deposit","quote-headline":"Buy crypto with a debit or credit card or your Simplex Bank Account","quote-subheadline":"Enter the amount of crypto asset you wo